import { useEffect, useState } from "react";
import { fetchContributionData } from "../services/fetchCommits"; // ✅ Correct Import

const Dashboard = () => {
  const [contributions, setContributions] = useState([]);

  useEffect(() => {
    async function loadContributions() {
      const data = await fetchContributionData();
      setContributions(data);
    }
    loadContributions();
  }, []);

  return (
    <div>
      <h2>User Contribution Percentage</h2>
      <table border="1">
        <thead>
          <tr>
            <th>User</th>
            <th>Commits</th>
            <th>Contribution (%)</th>
          </tr>
        </thead>
        <tbody>
          {contributions.map((contributor, index) => (
            <tr key={index}>
              <td>{contributor.user}</td>
              <td>{contributor.count}</td>
              <td>{contributor.percentage} %</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;
